#path="D://学习//code//C语言//strlen.txt"def sum():        count = 0        filename = open("aaab.txt",'r')        filecontents = filename.read()        for filecount in filecontents:                if filecount == '\n':                        count += 1        if filecontents[-1] != '\n':                count += 1        print(count)sum()'''def returnMulti():    return 1, 2, 3result = returnMulti()a, b, c = returnMulti()print (result[0], result[1], result[2])print (a, b, c)''''''import osdef sum():        count=0        filename=open('aaab.txt','r')        filecontents=filename.read()        for filecount in filecontents:                if filecount=='\n':                        count+=1        if filecontents[-1]!='\n':                count+=1        print(count)sum()'''